import React from "react";
import FundraisingProject from "./FundraisingProject";
import '../fundraisingProjects.css';


async function allProjects() {
    return await fetch(`http://localhost:18080/fundraising-projects/all`, {
        method: 'GET',
        headers: new Headers({
            "Authorization": sessionStorage.jwtToken
        })
    }).then(response => response.json());
}

console.log(allProjects().data)


export default function FundraisingProjects() {

    return (
        <ul className="wrapper">
            {allProjects().then(fps => console.log(fps))}
        </ul>
    );
}
